import React from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom"; //instalacion de las librerias
import Login from "../";
import Index from "../index";

export default function AppRoutes() {
  return (
    <Router>
      <Route>
        <Route exact path={["/login"]} component={Login} />{" "}
        {/*Proceso de enrutamiento, cada vez que cargue la pag enrute por el js,
                 En approutes cargamos todas las paginas que queramos que enrute, primer login da la ruta en la pag, segundo login llama a la clase*/}
        <Route exact path={["/"]} component={Index} />
        <Route exact path={["/index"]} component={Index} />
        <Route
          path={"*"}
          component={() => (
            <h1 style={{ marginTop: 300 }}>
              404 
              <br />
              Pagina no Encontrada
            </h1>
          )}
       />
      </Route>
    </Router>
  );
}
